--
-- Table structure for table `oms_order_info`
--

DROP TABLE IF EXISTS `oms_order_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `oms_order_info` (
  `order_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(20) NOT NULL,
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `consignee` varchar(60) NOT NULL DEFAULT '',
  `address` varchar(255) NOT NULL DEFAULT '',
  `mobile` varchar(60) NOT NULL DEFAULT '',
  `email` varchar(60) NOT NULL DEFAULT '',
  `member_id` int(5) NOT NULL DEFAULT '0',
  `postscript` varchar(255) NOT NULL DEFAULT '',
  `shipping_id` tinyint(3) NOT NULL DEFAULT '0',
  `pay_id` tinyint(3) NOT NULL DEFAULT '0',
  `goods_amount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `confirm_time` int(10) unsigned NOT NULL DEFAULT '0',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0',
  `shipping_time` int(10) unsigned NOT NULL DEFAULT '0',
  `shop` mediumint(8) unsigned DEFAULT '26',
  `distance` text,
  `payment_price` decimal(10,2) DEFAULT '0.00',
  `nopayment_price` decimal(10,2) DEFAULT '0.00',
  `warehouse_state` varchar(200) DEFAULT NULL,
  `order_status_set` varchar(200) DEFAULT NULL,
  `products_shipped` text,
  `receiptno` text,
  `customer_card` text,
  `customer_confirm` text,
  `print_set` text,
  `shop_arrive` text,
  `receiptno2` text,
  `stock_source` varchar(200) DEFAULT NULL,
  `lensname` varchar(200) DEFAULT NULL,
  `lensprice` float DEFAULT '0',
  `discountseals` float DEFAULT '0',
  `sealstxt` text,
  `topup` float DEFAULT '0',
  `corporate` text,
  `balance` int(11) DEFAULT '0',
  `printdate` int(11) DEFAULT '0' COMMENT '打印时间',
  `order_step` smallint(2) NOT NULL DEFAULT '0',
  `customer_care` smallint(1) NOT NULL,
  `customer_care_remark` varchar(255) DEFAULT NULL,
  `cancel_remark` varchar(800) DEFAULT NULL,
  `order_closed` smallint(1) DEFAULT '0',
  `order_closed_date` int(11) DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  KEY `user_id` (`user_id`),
  KEY `shipping_id` (`shipping_id`),
  KEY `pay_id` (`pay_id`)
) ENGINE=MyISAM AUTO_INCREMENT=79 DEFAULT CHARSET=utf8;
